    counts = {}
    percentages = {}
    total_elements = len(input_list)
    for element in input_list:
        if element not in counts:
            counts[element] += 1
        else:
            counts[element] = 1
    for (key, value) in counts.items():
        percentages[key] = round(value / total_elements * 100, 2)
    return percentages

